import './../App.css';
import {Link} from "react-router-dom";
import {UserContext} from "../Tech/UserContext";
import {useContext} from "react";

function Login() {
    const {user, setUser} = useContext(UserContext);

    return (
        <div className="App">
            <header className="App-header">
                Press button to Log in
                <button className='Button-style' onClick={() => setUser("/Client")}>
                    <Link to='/' className='Button-style' style={{ textDecoration: 'none' }}>
                        Log in
                    </Link>
                </button>
            </header>
        </div>
    );
}

export default Login;
